import React from 'react';
import '../style/header.css';
class Header extends React.Component {
  render() {
    return (
        <div className='header'>
            <img className='img' src='https://bizweb.dktcdn.net/100/473/812/themes/889220/assets/logo.png?1685001259345'></img>
            <div>
                <input className='input' type='search'name='search' placeholder='Vui lòng nhập từ khóa' />
                <button className='button' type='submit'name='submit'>Tìm kiếm</button>
            </div>
            <div className='information'>
                <div className='information1'>
                    <img className='img1' src='https://bizweb.dktcdn.net/100/473/812/themes/889220/assets/telephone-call.png?1685001259345'></img>
                    <div className='information2'>
                        <p className='hotlineh1'>0787628654</p>
                    </div>
                </div>
                <div className='information1'>
                    <img className='img1' src='https://bizweb.dktcdn.net/100/473/812/themes/889220/assets/email.png?1685001259345'></img>
                    <p className='hotlineh1'>luan.le@gmail.com</p>
                </div>              
            </div>
            <div className='login'>
                <button className='button'>Đăng nhập</button>
            </div>
        </div>
    );
  }
}

export default Header;
